$.aCk=H.b(["I joined the App Development world (and Web Development) in 2020 (during the COVID-19 holidays). One of my friends suggested me to learn Flutter. I was reluctant at first, but began an online course soon after. The first few videos were not that interesting, but as I progressed further, I gradually fell in love with the UI components and the writing style. The cherry on top is that, since the framework supports hot reload \u26a1, one can easily see their changes reflect immediately (instead of waiting to compile for each and every change\ud83d\udca4). One can either use widgets from the built-in library or hand-craft their own UI from scratch. This freedom is what I love the most about Flutter. I ended up finishing the course and used the framework for my 5th semester\u2019s DBMS project (Flutter web was in beta). Yes, I ended up doing a lot of work by choosing dart instead of going for HTML, CSS: something that everyone knows, but I learnt a whole lot of widgets, dart packages and how to use them.\nSoon after, I started building beautiful UI which could be used across platforms. Now what I needed was knowledge on backend frameworks.\nFrontend without backend wouldn\u2019t make much sense (in most Web Apps), so I\u2019ve learnt PHP and NodeJS for backend and SQL and MongoDB for database.\n\n\nWhat I use\n\n  Jetbrains Suite  (Android Studio, IDEA) for Flutter, Java\n\n  Visual Studio Code (for JS and other web dev stuff)\n\n\nI use Windows as my main OS (drivers are better here; at least for my laptop) and WSL for my linux needs\n\n","I'm currently exploring new project and UI ideas.\n\nME_N Stack: Getting that 'R' in there. I'm learning ReactJS and making myself comfortable with it\n\n\nThe tech stack that I'm currently most comfortable with is:\n\n   Flutter for Front-End\n   NodeJS for Back-End\n   MongoDB for Database\n\n\nEdit: Gottem! I've completed one of my academic projects given in my 6th sem using ReactJS as the frontend which has contributed significantly to my understanding of the framework. So, guess what? I can do MERN now"],t.i)
